import '../../App.css';
import React from 'react';
import { connect } from 'react-redux';
import DashboardView from './components/DashboardView';
import LinkTileView from './components/LinkTileView';
import { fetchPhoto } from './actions/photoActions';
import Audio from './components/Audio';
import View from './components/View';

class App extends React.Component {
  componentDidMount() {
    this.props.fetchPhoto();
  }

  render(){
      return (
        <div>
          <View />
        </div>
        )
    }
  }

  function mapStateToProps(state, ownProps) {
    return {
      viewDetails: state.viewDetails,
      photoDetails: state.photoDetails,
      widgetDetails: state.widgetDetails
    }
  }

export default connect(mapStateToProps, { fetchPhoto })(App);
